column8:
用途：<br>
成分：化学合成油<br>
<br>
比較的ラフなクリアランスのトランスミッション用に適合させたM407 に対し、M408 は近年の比較的コンパクトな設計で、よりタイトなクリアランスを特徴とするトランスミッションに適合すべく、開発された製品です。<br>M408 は、タイトなクリアランスのトランスミッションに使用可能とすべく、粘度温度特性に優れる複数のハイドロカーボン系合成基油と、耐熱・溶解性に優れたエステル系合成基油を用い、更に摺動部分のせん断速度に対する柔軟な粘度追従を可能にする、厳選された機能性ポリマーを使用しています。<br>
<br>
化学合成油 <br>
動粘度（40℃）mm2/s 204<br>
動粘度（100℃）mm2/s 28.3<br>
粘度指数 178<center>

