用途：<br>
成分：特殊鉱物油<br>
<br>
Moty's独自のトライボロジー技術による、オールドファッションの鉱物油ベースと、Moty'sならではの機能添加剤の選定とバランスがおりなす独特の粘着付着特性に特徴がある、高い耐衝撃性を併せ持った最高級特殊鉱物ギヤオイルです。高温高負荷条件下における旧型車のトランスミッション・デファレンシャルはもとより、その粘度グレードの選定・競技のカテゴリーによっては、最新のモデルのトランスミッション、LSD等にも使用されています。<br>
この場合、化学合成油では得られない一味違ったシフトフィール、LSDのパフォーマンスを実現しています。<br>
<br>
特殊鉱物油<br>
動粘度（40℃）mm2/s 424<br>
動粘度（100℃）mm2/s 31.5<br>
粘度指数 106<br><center>

